import React from "react";
import "../../Styles/Shared/CheckoutProduct.scss";
import cartItem1 from "../../Assets/cartItem1.png";
import DeleteForeverOutlinedIcon from "@material-ui/icons/DeleteForeverOutlined";
import { IconButton } from "@material-ui/core";

function CheckoutProduct({ onClickDecrease, onClickIncrease }) {
  return (
    <div className='cartMenu__item'>
      <img src={cartItem1} alt='' />
      <div className='cartItem__con'>
        <div className='cartItem__header'>
          <h5>War Arena: Titan Wars</h5>
          <DeleteForeverOutlinedIcon />
        </div>
        <p>Games</p>
        <div className='cartItem__price'>
          <div className='cartItem__quantity'>
            <IconButton onClick={onClickDecrease}>-</IconButton>
            <h4>{quantity}</h4>
            <IconButton onClick={onClickIncrease}>+</IconButton>
          </div>
          <h4>72$</h4>
        </div>
      </div>
    </div>
  );
}

export default CheckoutProduct;
